    WHERE AdminID = p_AdminID AND Password = p_Password;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_loginStudent` (IN `p_IDSinhVien` VARCHAR(50), IN `p_Password` VARCHAR(50))   BEGIN
